const data = $input.all();
const result = {};
let itHead = null;

// --- Pass 1: Detect IT Head ---
data.forEach(item => {
  const row = item.json;
  const role = (row.Role || '').trim().toLowerCase();

  if (role === 'it head') {
    itHead = {
      id: row.ID,
      name: row.EmployeeName,
      username: row.UseName,
      position: row.Position
    };
  }
});

// --- Pass 2: Build Department Structure ---
data.forEach(item => {
  const row = item.json;
  const dept = row.Department || 'Unknown';
  const role = (row.Role || '').trim().toLowerCase();

  if (!result[dept]) {
    result[dept] = { "Head": [], "IT Head": [], "User": [] };
  }

  const employee = {
    id: row.ID,
    name: row.EmployeeName,
    username: row.UseName,
    position: row.Position
  };

  //  Add to Head if role = Head
  if (role === 'head' || role === 'it head') {
    result[dept]["Head"].push(employee);
  }

  //  Add all employees (heads & users) under User list
  if (role === 'head' || role === 'user' || role === 'it head') {
    result[dept]["User"].push(employee);
  }
});

// --- Pass 3: Attach IT Head to all departments ---
if (itHead) {
  Object.keys(result).forEach(dept => {
    result[dept]["IT Head"] = [itHead];
  });
}

// --- Optional: Sort all lists by name ---
Object.keys(result).forEach(dept => {
  ["Head", "User"].forEach(role => {
    result[dept][role].sort((a, b) => a.name.localeCompare(b.name));
  });
});

return [{ json: result }];

